import React, { useState } from 'react';

function App() {

const [count, setCount] = useState(4)

function minusOne() {
  setCount(prevCount => prevCount - 1)
  setCount(prevCount => prevCount - 1)
}

function plusOne() {
  setCount(count + 1)
}

  return (
    <>
    <button onClick={minusOne}>-</button>
    <span>{count}</span>
    <button onClick={plusOne}>+</button>
    </>
  );
}

export default App;
